@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix atm: <http://example.com/atm#> .

atm:ATM a owl:Class .

atm:UserTransaction a owl:Class .

atm:CardInsertion a owl:Class .

atm:logs a rdf:Property ;
    rdfs:domain atm:ATM ;
    rdfs:range atm:UserTransaction .

atm:after a rdf:Property ;
    rdfs:domain atm:UserTransaction ;
    rdfs:range atm:CardInsertion .

atm:UserTransaction rdfs:subClassOf [
    a owl:Restriction ;
    owl:onProperty atm:after ;
    owl:someValuesFrom atm:CardInsertion
] .

atm:ATM rdfs:subClassOf [
    a owl:Restriction ;
    owl:onProperty atm:logs ;
    owl:someValuesFrom atm:UserTransaction
] .
